<div class="entities" style="line-height: 2.5; direction: ltr">Role of endogenous cannabinoids in synaptic signaling . Research of cannabinoid actions was boosted in the 1990s by remarkable discoveries including identification of endogenous compounds with cannabimimetic activity ( endocannabinoids ) and the cloning of their molecular targets , the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and CB2 receptors . Although the existence of an endogenous cannabinoid signaling system has been established for a decade , its physiological roles have just begun to unfold . In addition , the behavioral effects of exogenous cannabinoids such as 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00470
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 , the major active compound of hashish and marijuana , await explanation at the cellular and network levels . Recent physiological , pharmacological , and high-resolution anatomical studies provided evidence that the major physiological effect of cannabinoids is the regulation of neurotransmitter release via activation of presynaptic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors located on distinct types of axon terminals throughout the brain . Subsequent discoveries shed light on the functional consequences of this localization by demonstrating the involvement of endocannabinoids in retrograde signaling at GABAergic and glutamatergic synapses . In this review , we aim to synthesize recent progress in our understanding of the physiological roles of endocannabinoids in the brain . First , the synthetic pathways of endocannabinoids are discussed , along with the putative mechanisms of their release , uptake , and degradation . The fine-grain anatomical distribution of the neuronal cannabinoid receptor 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 is described in most brain areas , emphasizing its general presynaptic localization and role in controlling neurotransmitter release . Finally , the possible functions of endocannabinoids as retrograde synaptic signal molecules are discussed in relation to synaptic plasticity and network activity patterns .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Cannabinoid receptors in acute and chronic complications of atherosclerosis . Atherosclerosis is a chronic inflammatory disease that is the primary cause of myocardial infarction and stroke , which occur after sudden thrombotic occlusion of an artery . A growing body of evidence suggests that cannabinoid signalling plays a fundamental role in atherosclerosis development and its clinical manifestations . Thus , CB2 receptors are protective in myocardial ischaemia / reperfusion and implicated in the modulation of chemotaxis , which is crucial for the recruitment of leukocytes during inflammation . Delta - 9 - 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00470
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ( THC ) - mediated activation has been shown to inhibit atherosclerotic plaque progression in a CB2 dependent manner . Although 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and CB2 expression has been reported on platelets , their involvement in thrombus formation is still controversial . While several reports suggest that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors may have a relevant role in neuroprotection after ischaemic stroke , recent studies show the protective effects in various forms of neuroprotection are not related to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 stimulation , and a protective role of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 blockade has also been reported . In addition , vascular and myocardial 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors contribute to the modulation of blood pressure and heart rate . It is tempting to suggest that pharmacological modulation of the endocannabinoid system is a potential novel therapeutic strategy in the treatment of atherosclerosis . For these purposes , it is important to better understand the complex mechanisms of endocannabinoid signalling and potential consequences of its pharmacological modulation , as it may have both pro - and anti-atherosclerotic effects .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">DB00898 inhibits luteinizing hormone-releasing hormone release by activating the endocannabinoid system . We hypothesized that ethanol ( EtOH ) might act through the endocannabinoid system to inhibit luteinizing hormone-releasing hormone ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01148

</mark>
 ) release . Therefore , we examined the mechanism by which EtOH and anandamide ( AEA ) , an endogenous cannabinoid , inhibit

 receptors were stably expressed in CHO -

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Possible involvement of endocannabinoids in the increase of morphine consumption in maternally deprived rat . Whether adolescent exposure to chronic

</mark>
 ( THC ) facilitates progression to opioid consumption is still controversial . In a maternal deprivation model ( 3 h daily from postnatal day 1-14 ) , we previously reported that adolescent exposure to chronic THC blocks morphine dependence in maternally deprived ( D ) rats . Owing to the existence of a functional cross-interaction between the opioid and cannabinoid systems in reward , we evaluated if the vulnerability to opiate reward in D rats , may involve an alteration of the endocannabinoid system . Anandamide and 2 - arachidonoylglycerol ( 2 - AG ) , were quantified in the striatum and mesencephalon of adolescent and adult D and non-deprived ( animal facility rearing , AFR ) rats by isotope dilution liquid chromatography-mass spectrometry . Oral morphine self-administration behavior was analyzed for 14 weeks , 24 days after chronic injection of the cannabinoid

</mark>
 receptor antagonist / inverse agonist , SR141716A ( 3 mg / kg ) for 2 weeks during adolescence ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 35-48 ) . Adolescent D rats exhibited higher basal levels of anandamide than adolescent AFR rats in the nucleus accumbens ( 38 % ) , the caudate-putamen nucleus ( 62 % ) and the mesencephalon ( 320 % ) , whereas adult D rats showed an increase of anandamide and 2 - AG levels in the nucleus accumbens ( 50 % and 24 % , respectively ) and of 2 - AG in the caudate-putamen nucleus ( 48 % ) , compared to adult AFR rats . Chronic administration of SR141716A to adolescent D rats blocked the escalation behavior in the morphine consumption test . Our data suggest that altered brain endocannabinoid levels may contribute to the escalation behavior in the morphine consumption test in a maternal deprivation model .</div>

 as a pancreatic protein could be involved in specific variation of beta-cell mass and might also contribute to the regulation of insulin secretion at this level . According to our results , TM17 is essentially involved in

<div class="entities" style="line-height: 2.5; direction: ltr">Behavioral suppression induced by cannabinoids is due to activation of the arachidonic acid cascade in rats .

 ( THC ) is the principle psychoactive ingredient of marijuana and produces various psychoactive effects through the brain cannabinoid (

 ) receptor . The

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 receptor . Delta (8 ) - THC and the potent synthetic

 receptor agonist HU - 210 dose-dependently inhibited lever-pressing performance . The Delta (8 ) - THC-induced suppression was significantly antagonized by the cyclooxygenase (

 ) inhibitors diclofenac ( 32 mg / kg , i . p . ) , aspirin ( 10 mg / kg , i . p . ) and indomethacin ( 10 mg / kg , i . p . ) . The suppressive effect of HU - 210 was also significantly antagonized by 32 mg / kg diclofenac . Prostaglandin E ( 2 ) ( 3.2 microg / rat , i . c . v . ) , the final product of the arachidonic acid cascade , significantly inhibited lever pressing similar to Delta (8 ) - THC and HU - 210 . In conclusion , we found that suppression of lever-pressing behavior induced by cannabinoids was mediated through activation of the arachidonic acid cascade via the

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacogenetics of antipsychotic-induced weight gain : review and clinical implications . Second-generation antipsychotics ( SGAs ) , such as risperidone , clozapine and olanzapine , are the most common drug treatments for schizophrenia . SGAs presented an advantage over first-generation antipsychotics ( FGAs ) , particularly regarding avoidance of extrapyramidal symptoms . However , most SGAs , and to a lesser degree FGAs , are linked to substantial weight gain . This substantial weight gain is a leading factor in patient non-compliance and poses significant risk of diabetes , lipid abnormalities ( that is , metabolic syndrome ) and cardiovascular events including sudden death . The purpose of this article is to review the advances made in the field of pharmacogenetics of antipsychotic-induced weight gain ( AIWG ) . We included all published association studies in AIWG from December 2006 to date using the Medline and ISI web of knowledge databases . There has been considerable progress reaffirming previous findings and discovery of novel genetic factors . The

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Self-administration of cannabinoids by experimental animals and human marijuana smokers . Drug self-administration behavior has been one of the most direct and productive approaches for studying the reinforcing effects of psychoactive drugs , which are critical in determining their abuse potential . Cannabinoids , which are usually abused by humans in the form of marijuana , have become the most frequently abused illicit class of drugs in the United States . The early elucidation of the structure and stereochemistry of 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00470
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ( THC ) in 1964 , which is now recognized as the principal psychoactive ingredient in marijuana , activated cannabinoid research worldwide . This review examines advances in research on cannabinoid self-administration behavior by humans and laboratory animals . There have been numerous laboratory demonstrations of the reinforcing effects of cannabinoids in human subjects , but reliable self-administration of cannabinoids by laboratory animals has only recently been demonstrated . It has now been shown that strong and persistent self-administration behavior can be maintained in experimentally and drug-naïve squirrel monkeys by doses of THC comparable to those in marijuana smoke inhaled by humans . Furthermore , reinforcing effects of some synthetic 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21554
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 cannabinoid agonists have been recently reported using intravenous and intracerebroventricular self-administration procedures in rats and mice . These findings support previous conclusions that THC has a pronounced abuse liability comparable to other drugs of abuse under certain experimental conditions . Self-administration of THC by squirrel monkeys provides the most reliable animal model for human marijuana abuse available to date . This animal model now makes it possible to study the relative abuse liability of other natural and synthetic cannabinoids and to preclinically assess new therapeutic strategies for the treatment or prevention of marijuana abuse in humans .</div>

 ( MCR 4 ) and CB ( 1 ) cannabinoid receptors independently modulate food intake . Although an interaction between the cannabinoid and melanocortin systems has been found in recovery from hemorrhagic shock , the interaction between these systems in modulating food intake has not yet been examined . The present study had two primary purposes : 1 ) to examine whether the cannabinoid and melanocortin systems act independently or synergistically in suppressing food intake ; and 2 ) to determine the relative position of the CB ( 1 ) receptors in the chain of control of food intake in relation to the melanocortin system . Rats were habituated to the test environment and injection procedure and then received intracerebroventicular injections of various combinations of the MCR 4 receptor antagonist JKC - 363 , the CB ( 1 ) receptor agonist Delta ( 9 ) - tetrahydrocannabinol , the MCR 4 receptor agonist alpha-MSH , or the cannabinoid CB ( 1 ) receptor antagonist SR 141716 . Food intake and locomotor activity were then recorded for 120 min . When administrated alone , SR 141716 and alpha-MSH dose-dependently attenuated baseline feeding , whereas sub-anorectic doses of SR 141716 and alpha-MSH synergistically attenuated baseline feeding when combined . Delta ( 9 ) -

<div class="entities" style="line-height: 2.5; direction: ltr">Dopamine agonist-induced hypothermia and disruption of prepulse inhibition : evidence for a role of D3 receptors ? The dopamine D3 / D2 receptor agonists 7 - OH-DPAT , quinpirole , quinelorane , and PD128907 , the mixed dopamine agonist apomorphine , the D2 agonist bromocriptine , and the D1 / D5 agonist SKF 38393 were examined in models of hypothermia and prepulse inhibition ( PPI ) in Wistar rats . As dopamine agonist-induced hypothermia has been proposed as a model of D3 receptor function , and dopamine agonists are known to disrupt PPI , drug potencies to induce hypothermia were established and compared with doses necessary to disrupt PPI . 7 - OH-DPAT , quinpirole , quinelorane , PD128907 , and apomorphine , reduced body temperature and disrupted PPI with a similar rank order of potency ( quinelorane &gt; quinpirole = 7 - OH-DPAT &gt; PD128907 = apomorphine ) .

 and SKF 38393 were ineffective in both models . In a separate study , the dopamine reuptake inhibitors cocaine and GBR 12909 had no effect on PPI . In a final set of studies , the D2 / D3 antagonist raclopride blocked both 7 - OH-DPAT-induced hypothermia and 7 - OH-DPAT-induced PPI disruption . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) was cloned . This prompted the search for endogenous ligands . In 1992 , N-arachidonoylethanolamine ( anandamide ) was isolated from pig brain as an endogenous ligand , and in 1995 , 2 - arachidonoylglycerol was isolated from rat brain and canine gut as another endogenous ligand . Both anandamide and 2 - arachidonoylglycerol exhibit various cannabimimetic activities . The results of structure-activity relationship experiments , however , revealed that 2 - arachidonoylglycerol , but not anandamide , is the intrinsic natural ligand for the cannabinoid receptor . 2 - Arachidonoylglycerol is a degradation product of inositol phospholipids that links the function of cannabinoid receptors with the enhanced inositol phospholipid turnover in stimulated tissues and cells . The possible physiological roles of cannabinoid receptors and 2 - arachidonoylglycerol in various mammalian tissues such as those of the nervous system are discussed .</div>

 receptors ; their ubiquity underlies a wide variety of effects . THC disappears from extracellular spaces by dissolving in lipid rich membranes , and not by excretion from the body . This is followed by a slow release , leading to long lasting effects originating from brain areas containing a large proportion of spare receptors ( &quot; reserve receptors &quot; ) . Far from mimicking the effects of endocannabinoids , THC caricatures and disturbs them . It induces both psychical and physical dependencies , but the perception of withdrawal is weak on account of its very slow elimination . THC disturbs cognition . Acutely , it develops anxiolytic - and antidepressant-like effects , which causes a lot of users to abuse THC , thus leading to a tolerance ( desensitization of

 receptors ) making anxiety and depression to reappear more intensely than originally . THC has close relationships with schizophrenia . It incites to tobacco , alcohol and heroine abuses .</div>

 ( Delta ( 9 ) - THC ) , the principal psychoactive constituent of the Cannabis sativa plant , and other agonists at the central cannabinoid ( CB ( 1 ) ) receptor may induce characteristic psychomotor effects , psychotic reactions and cognitive impairment resembling schizophrenia . These effects of Delta ( 9 ) - THC can be reduced in animal and human models of psychopathology by two exogenous cannabinoids , cannabidiol ( DB09061 ) and SR141716 . DB09061 is the second most abundant constituent of Cannabis sativa that has weak partial antagonistic properties at the CB ( 1 ) receptor . DB09061 inhibits the reuptake and hydrolysis of anandamide , the most important endogenous CB ( 1 ) receptor agonist , and exhibits neuroprotective antioxidant activity . SR141716 is a potent and selective CB ( 1 ) receptor antagonist . Since both DB09061 and SR141716 can reverse many of the biochemical , physiological and behavioural effects of CB ( 1 ) receptor agonists , it has been proposed that both DB09061 and SR141716 have antipsychotic properties . Various experimental studies in animals , healthy human volunteers , and schizophrenic patients support this notion . Moreover , recent studies suggest that cannabinoids such as DB09061 and SR141716 have a pharmacological profile similar to that of atypical antipsychotic drugs . In this review , both preclinical and clinical studies investigating the potential antipsychotic effects of both DB09061 and SR141716 are presented together with the possible underlying mechanisms of action .</div>

 ) , like Top 7 , retains its structure at high temperatures . Changes in CD spectra suggest that there are minor structural rearrangements between neutral and acidic environments for both proteins but that these do not make the proteins less stable at high temperatures . The anti-parallel beta-sheet is well conserved within the timescale simulated whereas there is a decrease of helical content when low pH and high-temperature conditions are combined . Concerted alanine mutations along the alpha-helices of the engineered Top 7 variant did not revert this trend when at pH 2 and 400K . The structural resilience of the anti-parallel beta-sheet suggests that the protein scaffold can accommodate varying sequences . The robustness of the Top 7 scaffold under extreme conditions of pH and temperature and its amenability to production in inexpensive bacterial expression systems reveal great potential for novel biotechnological applications .</div>

 and CP55940 inhibit the chemotactic response of microglia to Acanthamoeba culbertsoni , an opportunistic pathogen that is the causative agent of Granulomatous Amoebic Encephalitis , through activation of the CB2R . It is postulated that these exogenous cannabinoids superimpose an inhibitory effect on pro-chemotactic endocannabinoids that are elicited in response to Acanthamoeba . Furthermore , the collective results suggest that the CB2R plays a critical immune functional role in the CNS .</div>

 ( THC ) , the main active ingredient in cannabis , ( 2 ) reduced intravenous self-administration of the synthetic cannabinoid

 receptor agonist WIN 55,212- 2 [ ( R ) - ( + ) - [ 2,3- dihydro - 5 - methyl - 3 [ ( 4 - morpholinyl ) methyl ] pyrrolo [ 1,2 , 3 - de ] -1,4- benzoxazinyl ] - ( 1 - naphthalenyl ) methanone , mesylate salt ] , and ( 3 ) decreased THC-induced dopamine elevations in the shell of the nucleus accumbens . Altogether , our results indicate that blockade of alpha 7 nicotinic receptors reverses abuse-related behavioral and neurochemical effects of cannabinoids . Importantly , MLA reversed the effects of cannabinoids at doses that did not produce depressant or toxic effects , further pointing to alpha 7 nicotinic antagonists as potentially useful agents in the treatment of cannabis abuse in humans .</div>
